query UserCatalogsListQuery($username: ID, $id: ID!) {
  userResult(username: $username, id: $id) {
    __typename
    ... on User {
      id
      viewerEdge {
        id
        catalogsConnection(pagingOptions: {limit: 5}, type: LISTS, visibility: PUBLIC) {
          __typename
          catalogs {
            id
            ...UserCatalogsList_catalog
            __typename
          }
          paging {
            __typename
            nextPageCursor {
              id
              __typename
            }
          }
        }
        __typename
      }
      __typename
    }
  }
  readingList: getPredefinedCatalog(userId: $id, type: READING_LIST) {
    __typename
    ... on Catalog {
      id
      ...UserCatalogsList_catalog
      __typename
    }
  }
}

fragment CatalogCover_catalogEntity on CatalogEntity {
  __typename
  ... on Post {
    previewImage {
      id
      alt
      __typename
    }
    __typename
    id
  }
}

fragment CatalogCovers_catalogEntity on CatalogEntity {
  ...CatalogCover_catalogEntity
  __typename
}

fragment getCatalogSlugId_Catalog on Catalog {
  id
  name
  __typename
}

fragment userUrl_user on User {
  __typename
  id
  customDomainState {
    live {
      domain
      __typename
    }
    __typename
  }
  hasSubdomain
  username
}

fragment catalogUrl_catalog on Catalog {
  id
  predefined
  ...getCatalogSlugId_Catalog
  creator {
    ...userUrl_user
    __typename
    id
  }
  __typename
}

fragment CatalogPreview_catalog on Catalog {
  id
  name
  postItemsCount
  predefined
  creator {
    username
    __typename
    id
  }
  viewerEdge {
    followersCount
    __typename
    id
  }
  itemsConnection(pagingOptions: {limit: 5}) {
    items {
      catalogItemId
      entity {
        ...CatalogCovers_catalogEntity
        __typename
      }
      __typename
    }
    __typename
  }
  ...catalogUrl_catalog
  __typename
}

fragment UserCatalogsList_catalog on Catalog {
  id
  visibility
  postItemsCount
  ...CatalogPreview_catalog
  __typename
}
